INSERT INTO `mini_info` VALUES ('0810905e4d84475e95c143af6321c2c4', '趣住啊民宿', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/114367b173901e4e382ab75a81e997f0.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/114367b173901e4e382ab75a81e997f0.jpg', '趣住啊－一个有趣的海外民宿预定及社交平台 趣住啊，由具有互联网背景的自由行玩家踏遍全球美景后，热血而造 趣住啊，不断丰富平台上的全球民宿，最自由的出行方式 搭建您与民宿主人最直接的沟通桥梁，感受世间的风土人情，让旅行更有深度 趣住啊特色功能 －为您精选海外民宿，体验最当地的人情之旅 －直接联系房东，沟通无障碍 －当地人合作管理模式，保证民宿品质，让您安心入住 －支持支付宝和微信支付，人民币结算，预订快捷方便 趣住啊，趣住进世界。 请关注我们 官方网站：www.bnbtrip.com 新浪微博：趣住啊 微信公众号：趣住啊', '237');
