INSERT INTO `mini_info` VALUES ('0cf7053b502d4330aa7ca4e0c6e5740e', '土巴兔家居装修', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/1373245205ad8d6b0b7f2a38532b6ca7.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/1373245205ad8d6b0b7f2a38532b6ca7.jpg', '土巴兔家居装修是新房,二手房,工装等各类房屋室内设计,装潢装饰效果图,半包全包家庭家居装修首选一站式服务平台,包含装修公司、装修工人的家装平台。   \n\n土巴兔成立于2008年，是面向用户的一站式家装服务平台，目前已开通250个城市分站，累计服务1400万中国家庭。在土巴兔，用户可获得免费验房、免费设计与报价、免费监理、家居电商、品质施工、装修贷款等服务，一站式享受品质家装，让您省钱、省心、省时间。   \n\n打开微信，搜索\"土巴兔\"即可访问。   \n咨询热线：4006-900-288\n网址：www.to8to.com', '317');
