INSERT INTO `mini_info` VALUES ('2a71cbac7c0c4e01bc402fa82971472d', '名画滤镜APP', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/797b0de5ce0105e73f5e36f88613fb3d.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/797b0de5ce0105e73f5e36f88613fb3d.jpg', '名画滤镜APP第一时间推出微信小程序版本啦！想把照片变成像梵高《星空》那样的艺术作品吗？无需安装APP，名画滤镜小程序就可以帮到你。名画滤镜小程序是一款基于人工智能的P图利器，轻松把你的照片变成世界名画风格，艺术感爆棚，其移动APP版本更入选爱范儿MindStore周榜，快来试试名画滤镜，体验一下梵高怎样“画”出你的照片，此外还有莫奈《日出印象》、蒙克《尖叫》以及水彩、素描、彩色玻璃、蜡笔等多种名画艺术风格可供选择，让我们与艺术大师们汇聚一堂，聆听、体验他们的艺术大手笔！', '472');
