INSERT INTO `mini_info` VALUES ('945c05eb1390439db9a86285172b46dc', '91影像助手', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/bbc6efa48e1f600b4a8cdbfccf9f6549.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/bbc6efa48e1f600b4a8cdbfccf9f6549.jpg', '「91影像助手」是一款医学影像查询工具，搭建了一个医学影像信息数据库，用户可以通过点击分类菜单栏、输入关键词搜索查询医学影像的相关内容。「91影像助手」隶属于杭州至临医疗科技有限公司（以下简称”至临医疗科技”），主要为医生群体提供系统化、便捷化的医学影像信息查询服务。\n医生在工作和学习中遇到需要查询资料的情况时，可以通过检索「91影像助手」来获取相关信息。', '351');
