INSERT INTO `mini_info` VALUES ('94e64576a1ac49b29367ec94449b3093', '网易有道词典', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/ebce5658c1c1dab990f875922ef0e772.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/ebce5658c1c1dab990f875922ef0e772.jpg', '网易有道词典支持中英日韩法德葡俄等多语种翻译，是中国最受欢迎的免费全能翻译工具，数据权威，发音地道，工作学习旅游必备。', '347');
