INSERT INTO `mini_info` VALUES ('9bc474433a4042a79b377cbb76866769', '深睡大师', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/d1c2074e72fd9a4b2c99d1a4d88f6870.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/d1c2074e72fd9a4b2c99d1a4d88f6870.jpg', '由考拉FM出品的助眠类音频程序“深睡大师”，集聚了万千催眠好声音，帮你放松熟睡，给你高质量睡眠。\r\n深睡大师，包括了天籁的大自然音乐、治愈系暖文、优美散文及专家助眠引导等优质内容。每晚收听这些声音，使人心情宁静，轻松地进入睡眠，从而告别失眠、烦躁和抑郁的生活。', '529');
