INSERT INTO `mini_info` VALUES ('9cc12e686a7c4f4b95f9ca713734248e', '企查查企业查询', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/3adf45208ba0fcd62ff4fe87989fcebf.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/3adf45208ba0fcd62ff4fe87989fcebf.jpg', '企查查为用户提供快速查询企业工商信息、法院判决信息、关联企业信息、法律诉讼、失信信息、被执行人信息、知识产权信息、公司新闻、招聘信息、企业年报等服务。', '295');
INSERT INTO `mini_info` VALUES ('9d071774df1b41969578d01e6666ba5d', '一些事一些情', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/eafad4d7cf66365c219e0700a2941759.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/eafad4d7cf66365c219e0700a2941759.jpg', '在这里，你可以随时重温回顾、实时在线收听全球下载量最高的华语电台节目《一些事一些情》。这档与年轻人分享成长、感情、生活的电台节目，让你感受乐观、自信、爱的生活时尚！', '467');
INSERT INTO `mini_info` VALUES ('9d2ae0e04cf8451d94c9aa6e98719fa0', '美家帮效果图', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/1fce5a8cc10ebecd6723aa14ec1a0a1a.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/1fce5a8cc10ebecd6723aa14ec1a0a1a.jpg', '《美家效果图》是美家帮为业主精心打造的一款家装设计软件，让您在海量高清实景图中发现装修之美，探寻设计灵感。', '364');
INSERT INTO `mini_info` VALUES ('9d4cb2f9ddb64a19ad53382add59b885', '海南新房导购', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/bcc18f2b1f8179cba94751136bc43b04.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/bcc18f2b1f8179cba94751136bc43b04.jpg', '看房吗网是海南最权威的旅游地产网购平台，独有置业专家楼盘评测、无人机楼盘航拍带您身临其境了解海南楼盘信息。', '584');
INSERT INTO `mini_info` VALUES ('9db0471206bf490187899270aa21a184', '微快递+', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/5f102f7fd60e9600ada0eb82c012b639.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/5f102f7fd60e9600ada0eb82c012b639.jpg', '微快递+是为用户提供快递综合解决方案，提供最全查快递、寄快递，提升客户的快递使用体验和满足个性化服务需求。', '283');
INSERT INTO `mini_info` VALUES ('9ee3f4a395e3463980696128d5dfd486', '新东方在线网络课堂', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/a1e1c30363a692b3e2ee89b3e574eaf7.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/a1e1c30363a692b3e2ee89b3e574eaf7.jpg', '新东方在线网络课堂为已购课学员提供在线听课的功能，同时也包含了课程的搜索与在线咨询', '83');
INSERT INTO `mini_info` VALUES ('9fc3f878456041c6a7a36d1f3b7df1fe', '组织控', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/ae3f37d546601e960687d89bba04da1e.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/ae3f37d546601e960687d89bba04da1e.jpg', '##10秒拥有你的组织团队管理小程序\n能够为组织提供公告、投票、讨论等扩展功能\n\n##使用场景\n\n微信群管理:\n如果你有几个微信群，那么“组织控”可以有效的帮你把群组织起来，发起讨论，投票。提高群活跃度\n\n行业组织:\n如果你在一个行业，需要一个工具来积累组织的内容，组织控可以很好的帮助你发起讨论，纪录等\n\n家庭私密/老乡聚义:\n对于私密组织来说，只要你设定组织为“非公开”，那么你就可以将“组织控”作为一个私密圈子，和你想分享的人一起分享\n\n班级/企业/团队管理:\n班长，组长，社长，聪明的你们肯定知道怎么通过“组织控”怎么帮助您了。', '595');
INSERT INTO `mini_info` VALUES ('a06f6be0f56d48159319874398ad8e8f', '黄历万年历', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/1b1286936a0565e90654b3f2b930b1a6.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/1b1286936a0565e90654b3f2b930b1a6.jpg', '黄历万年历为您提供祈福、纳财、嫁娶等吉日查询服务。以及每日宜忌、诸神方位灯信息，并编制出了具有特色的通胜模式日历，以便查看。', '375');
