INSERT INTO `mini_info` VALUES ('a322d362a6e34ffa81bcd13eb7e8ffe0', '股票灯塔', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/66017a4baf1d6413cad2ce003c683042.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/66017a4baf1d6413cad2ce003c683042.jpg', '股票灯塔是一款全新的人工智能大数据炒股工具。灯塔表哥7X24小时智能问股诊股、大数据选股；更有筹码分布、相似K线、历史回看、个股直播等大数据分析工具。灯塔让股市变得从未如此清晰，让炒股变的从未如此轻松。', '499');
