INSERT INTO `mini_info` VALUES ('ba9bcb7fd99142409311619fdcc73fd3', '玩乐小帮手', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/9ca0e47588f8507dbefc4d6cf0ea98e3.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/9ca0e47588f8507dbefc4d6cf0ea98e3.jpg', '互动吧是最大的活动平台，共有5000万注册用户，同时在线活动近20万个，“玩乐小帮手”是互动吧官方微信小程序，品类覆盖亲子、手工、运动、娱乐、派对、培训、互联网等，通过这些精彩的活动，互动吧能让你发现更美好的生活方式！', '87');
INSERT INTO `mini_info` VALUES ('bacb768554c94f3ca71eb300ed319ddd', '土巴兔装修效果图', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/d1aec150160465db9f2009b2915f7a07.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/d1aec150160465db9f2009b2915f7a07.jpg', '精选海量高清家居装修实景效果图；丰富的家装户型图分类，数十万套实景家居装修效果图案例，随时随地发现家居生活的美好灵感！\n\n数十种类型家居装修效果图琳琅满目，任你收藏...\n【风格◆装修设计效果图】简约|现代|中式|欧式|美式|田园|地中海\n【房型◆装修设计效果图】小户型|二居|三居|四居|复式|别墅\n【局部◆装修设计效果图】背景墙|吊顶|隔断|窗帘|飘窗|榻榻米|橱柜|博古架|阁楼|隐形门\n【房间◆装修设计效果图】客厅|卧室|餐厅|厨房|卫生间|阳台|书房|玄关|儿童房\n每日更新精选家居装修户型设计效果图，释放你的想象力！百万土巴兔网友交流互动，彻底提升你的居家品味！\n◆ 这里的户型设计效果图片每张都被很多人喜欢过；\n◆ 她让我们无法停止对美丽生活的向往；\n◆ 掌上视觉盛宴，随手发现生活中的美好；\n\n【关注我们】\n土巴兔官方： http://www.to8to.com\n新浪微博： http://weibo.com/to8to\n腾讯微博： http://t.qq.com/ito8to\n腾讯空间： http://user.qzone.qq.com/1596974915\n公众微信号：土巴兔装修家居\n客服电话：4006-900-288\n\n关于装修，一切你想要的，尽在土巴兔~ \n我们还在努力改进，欢迎您提出宝贵的建议，帮助我们持续改善服务，让装修行业变的更加阳光透明。', '310');
