INSERT INTO `mini_info` VALUES ('c1f99af207664ddcabc9e558e0e79cd2', '云学体验推广', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/fb9514c3113739f833708bae46ea30c6.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/fb9514c3113739f833708bae46ea30c6.jpg', '云学是配合云学APP所做的手机版推广小程序，云学APP是立足于移动互联网的“掌上培训课堂”，致力于改变人们的学习方式，打造移动学习的首选平台，创造智能便捷的全员学习的文化空间。', '326');
INSERT INTO `mini_info` VALUES ('c1f9b521e35841988d2abd35af976993', '医生工具箱', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/18b85e02b3a204d2bdcaeba3ec43cbeb.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/18b85e02b3a204d2bdcaeba3ec43cbeb.jpg', '医生工具箱一款专门为医生量身打造的小程序，他能让您在微信里，轻松查看临床指南，浏览医学资讯，翻译医学词汇，检索专业文献，查询药品，分析化验单，完成医学计算，从而帮助您在科研及临床中，极大的提升工作效率', '245');
INSERT INTO `mini_info` VALUES ('c291c7de469f42458bd59204dfa177be', '化妆品点评', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/6cf53781976459492b2820f676333242.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/6cf53781976459492b2820f676333242.jpg', '你的美妆消费指南—美妆界的大众点评，中国COSME！消费者真实口碑，杜绝水军！买前查口碑，拔草不后悔！', '449');
