INSERT INTO `mini_info` VALUES ('c3afaad55a094d83ad1f089f5dae36fc', '孕期提醒', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/337e6ef2db48773625e335ae2f671b6d.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/337e6ef2db48773625e335ae2f671b6d.jpg', '孕期实用工具，胎宝宝发育和准妈妈自身变化；产检计划、孕期体重管理计划和饮食计划；预产期计算、胎教音乐、症状解读等小工具。', '501');
INSERT INTO `mini_info` VALUES ('c4642c8cefb4492da05a7fae49ca53d0', 'BP助手', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/9244aea6c41af70e2225ecf004968b82.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/9244aea6c41af70e2225ecf004968b82.jpg', '7个步骤完成投资人最想看的BP，更有投资人帮你分析关键问题。', '465');
INSERT INTO `mini_info` VALUES ('c4e79ff8081e4cde82b0c669dd160a44', '天天练口语', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/db8d11da0a3a1586fdcd0683384cbcf7.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/db8d11da0a3a1586fdcd0683384cbcf7.jpg', '天天练口语，提供轻量级、多样化的口语练习服务，趣味与实用结合的口语学习模式，让口语练习不再枯燥！', '531');
INSERT INTO `mini_info` VALUES ('c5815406ffb048b28466652ed9c153ac', '小密圈', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/a22e6a0948363e59ae7ae9590cdbea1f.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/a22e6a0948363e59ae7ae9590cdbea1f.jpg', '小密圈是创作者连接铁杆粉丝，做出高品质社群，实现知识变现的工具。\n\n凯文·凯利提出过「一千位铁杆粉丝」的观点：任何从事创作或艺术的人，例如艺术家、音乐家、摄影师、工匠、演员、动画师、设计师、作家等，只要能获得一千位铁杆粉丝，就足够生计无忧，自由创作。\n\n到小密圈建一个圈子，按年收费，为自己的热爱写作，为自己的朋友写作。第二年，大多数用户还会在，一次销售，提供好的内容，粉丝会和你连接得越来越牢固。你的压力可能不会减少，你的快乐和满足感一定会增加。', '545');
INSERT INTO `mini_info` VALUES ('c59624ebc8b4414cb7341f1eb2d29845', '天天随手记账', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/9d80e37858e5357f58c44020e57d6009.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/9d80e37858e5357f58c44020e57d6009.jpg', '一款不会上传用户信息的记账小程序。', '25');
INSERT INTO `mini_info` VALUES ('c5addc7415d340a8a1f1fd11d3b46a2f', '表情集市', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/fe6c7fa2ce8c212ed1d3bdcbda30a844.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/fe6c7fa2ce8c212ed1d3bdcbda30a844.jpg', '这是你用了就离不开的表情小程序，收藏必备！各种聊天表情、专属红人表情、表情法力无边，污力淘淘；还能制作表情，让表情更具专属性！', '93');
