INSERT INTO `mini_info` VALUES ('c6537c991a1d4aa2b39dddef87d307fb', '博卡名片王', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/c0088e2844a12b54a72bcfc6894f7d09.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/c0088e2844a12b54a72bcfc6894f7d09.jpg', '微信首个名片类小程序。\n\n目前是微信内唯一 一个名片管理类小程序。在不占用任何手机空间的前提下，整合了名片扫描识别、智能搜索、无限派发名片、企业信息透视等功能。\n\n- 四重 OCR 引擎智能选择，精准识别名片信息\n- 名片三秒极速扫描，收纳名片与微信绑定，告别第三方 app\n- 手机空间零占用，从此告别卡慢急\n- 独家企业信息透视', '181');
INSERT INTO `mini_info` VALUES ('c687f6ff721741b8bed32a52c692ad9d', '土拨鼠装修效果图', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/0ff4ece91bafba8a33b0c34af14521d7.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/0ff4ece91bafba8a33b0c34af14521d7.jpg', '在线海量装修效果图，涵盖欧式、简约、地中海、田园、现代、美式、古典、新中式等26种装修风格；涉及不同居室，包括楼房、庭院、复式、公寓等户型；无论是你预算控制在5万以内的简装派还是预算超30万的豪华装修，你想要的装修设计，在这里总能及时找到！\n由土拨鼠装修网（tobosu.com）出品。\n装修公司入驻请访问：www.tobosu.com', '86');
