INSERT INTO `mini_info` VALUES ('c92ba8418efc420c806c2b228590a396', '搞笑精选App', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/824fd444e81c1687e3faac3e73c85ebc.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/824fd444e81c1687e3faac3e73c85ebc.jpg', '看一次，笑一辈子。\n集合天下所有的搞笑视频，搞笑图片，搞笑段子，让你在忙里偷闲时，享受更多快乐。', '605');
INSERT INTO `mini_info` VALUES ('c9fd1690d8c149d7a79b1e104fe52a24', '乐词斩', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/65e3e3233ad69ece759b87f1a9e970d9.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/65e3e3233ad69ece759b87f1a9e970d9.jpg', '新东方在线官方推出的背单词小程序，每天斩获15个单词，轻松掌握单词奥义，还有学霸模式随心斩。现有大学英语四级和六级词库。', '291');
INSERT INTO `mini_info` VALUES ('ca3e76b690604667bacdafc7630762ab', '手机随手查', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/90e4e44c51f00ec8e6bcd56bef1c6c2c.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/90e4e44c51f00ec8e6bcd56bef1c6c2c.jpg', '手机随手查，手机中国（cnmo.com）官方出品！随时随地了解最新手机报价！手机中国是一个实现了专业、时尚、品位并重的新兴手机媒体。', '16');
INSERT INTO `mini_info` VALUES ('ca4b448221d24252b9af190312d16662', '云梦助眠引导', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/5de9c10af380e54816b3d66181e2acd6.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/5de9c10af380e54816b3d66181e2acd6.jpg', '动静科技（Soundario Inc.）出品的音频助眠应用“云梦”，是通往甜美梦境的声音向导，将帮助你快速入睡。 “云梦”可以使你保持作息规律，将生物钟调节到最合适状态，令生活工作增强动力，保持效率的同时心情舒畅。 每当你感到入睡困难时，你只需要启动“云梦”APP，就可以获得：\n◇ 放松、和缓的睡眠引导，营造睡眠的心理舒适区，让您体会渐渐进入梦境中的美好过程。 \n◇ 安全、舒适的内容，全部经过专业心理咨询顾问审议，严格遵循睡眠专业理论指导。 \n◇ 温暖、平和的语音，由专业配音演员及广播主持人精心录制的人声。 \n◇ 优秀音乐人专门制作的弛放氛围音乐，以及双通道采样撷取的山海间自然之声。 \n◇ 顶尖音频编辑团队打造的混音，加强各频段声学效应的后期精良制作。 \n◇ 通过云端下载，同步更新的声音情境。确保有充分的选择，常梦常新。', '546');
INSERT INTO `mini_info` VALUES ('caaf44b76f1f43ada66071aca884375b', '鹿课堂手工教程', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/bd14841089a82aca810c1a2a340c796f.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/bd14841089a82aca810c1a2a340c796f.jpg', '鹿课堂是为热爱生活的人提供教学课程的社区。 我们拥有大量海内外布艺、饰品、旧物改造等优秀的手工作品教程，也有超多的家常菜、日式料理、洋快餐等厨艺教程。你可以轻松地浏览和查看，并且分享给你的好友。 鹿课堂力图打造成中国最好的互动社区，无论你是手工达人、料理大师、美容高手还是生活小窍门专家，在这里都可以找到志同道合的朋友。你也可以获取各种图文并茂的教程，享受自己动手带来的美好生活。', '121');
INSERT INTO `mini_info` VALUES ('cadcb3f273164f3d8f619edb319dd888', '群统计', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/96a63ba4dfc32fd3dfbed96f667bb0a2.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/96a63ba4dfc32fd3dfbed96f667bb0a2.jpg', '群统计是一款微信投票工具。使用它你可以便捷地发起投票，参与投票，分享投票。', '131');
INSERT INTO `mini_info` VALUES ('caed8a9da264409aba6a36e132f98b5b', '多伦多生活黄页', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/3de9c93f53b83eb15cfd85f913c2cf85.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/3de9c93f53b83eb15cfd85f913c2cf85.jpg', '加拿大多伦多生活必备利器，分类信息涵盖生活方方方面，装修、通渠、接送、家教、法律、报税、保险、汽车、交友、婚恋、家政、签证、机票、外汇、旅游、中医、牙医、生意服务，等等，无所不有。还有多伦多常用电话查询、天气预报，让你加国无忧。', '458');
