INSERT INTO `mini_info` VALUES ('d5fbd1f61f8740509b8ca02d1155440c', '人人词典', 'http :// bugua.oss - cn - beijing.aliyuncs.com / mini - app / icon / 3c9ed2832bec985aee2bf7f4f86652dd.jpg', 'http :// bugua.oss - cn - beijing.aliyuncs.com / mini - app / qrcode / 3c9ed2832bec985aee2bf7f4f86652dd.jpg', '人人影视字幕组官方旗下产品,\r\n		基于字幕组十年来积累的美剧日剧双语字幕大数据打造的的词典应用。开创性的采用声像并茂的双语字幕作为例句来诠释单词。', '539');
