INSERT INTO `mini_info` VALUES ('d7095f1726f241c684fefc2c31582049', '国信证券开户', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/c4fad49accfbc033f22972b0452cb698.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/c4fad49accfbc033f22972b0452cb698.jpg', '1、开户要领请记住两点：营业部搜索：3200  推荐人填写：320051006523\n      提交资料后第一时间打：15116315716（手机即是微信号）\n\n\n2、	开户前的准备工作：准备具有前置、后置摄像头的手机一台，身份证、银行卡；另外，客户手机中需安装“微信”。\n\n3、	开户首页、手机号验证、选择营业网点：这三步与掌厅App手机开户一致。\n1)	开户首页提示客户准备好哪些材料，客户点击“立即开户”开启开户流程。\n2)	验证手机号码：一样需要接收短信验证码进行手机号码验证。\n3)	选择营业网点：营业网点展示规则不变，距离客户近的网点排在前面，可以查看距离和地图。 \n4、	柜员信息展示+推荐人填写：此界面与掌厅App开户不同，增加了“推荐人”，客户可在此界面填写“推荐人”信息，关联开发关系。“推荐人”信息是选填，填写客户经理代码。\n\n\n5、	拍摄大头照照片：此环节与掌厅App略有不同，引导图片更明确，在拍摄完成界面也可以查看拍摄标准图片，方便对比。\n1)	引导图片： \n2)	拍摄界面：小程序直接调用了手机的摄像头，拍摄界面默认调用的是后置摄像头，而不是前置，需要客户切换到前置摄像头自拍。 \n3)	拍摄结果检查：客户可以点击“查看示例”，与自己拍摄的效果图进行对比。没有问题则点击“上传大头照”，进入下一步。\n \n\n6、	拍摄特定动作视频：客户需要手持身份证自拍一小段视频，最多15秒。\n1)	特定动作标准：与掌厅App一致，客户本人手持身份证，正面对着镜头录制一小段自拍视频，界面会默认提供卡通图引导。 \n2)	视频动作示范：客户点击“观看动作示范”，会开启一段真人拍摄示范视频。在展业过程中可尽量引导客户先看视频演示，再开始拍摄。\n3)	拍摄界面：小程序直接调用了手机的摄像头，拍摄界面默认调用的是后置摄像头，而不是前置，需要客户切换到前置摄像头自拍。客户点击“开始拍摄”后，小程序会自动为客户录制最长15秒视频，客户可以中途终止录制。\n4)	拍摄结果检查界面：系统默认展示客户拍摄的视频，点击即可播放。客户可以点击“观看动作示范”，再次与标准动作进行比对。客户点击“上传视频”，即可进入下一步。\n \n\n7、	拍摄身份证正反面：更新了清晰的身份证拍摄要点引导图片，客户可检查拍摄效果。\n1)	正面拍摄：客户观看拍摄要点卡通指引图后，点击“我知道了”开始拍摄，拍摄完成后，可以查看拍摄效果，并和拍摄指引图片进行效果比对。客户点击“上传照片”，进入反面拍摄。\n2)	反面拍摄：客户观看拍摄要点卡通指引图后，点击“我知道了”开始拍摄，拍摄完成后，可以查看拍摄效果，并和拍摄指引图片进行效果比对。\n\n8、	其他流程：客户在完成身份证反面拍摄后，进入“信息修改”环节，之后的各个步骤流程要点与掌厅App开户一致。流程如下所示：\n信息修改——选择市场——签署协议——设置密码——风险测评——三方签约——在线回访——开户状态查询。', '234');
