INSERT INTO `mini_info` VALUES ('d81d02739e104330b01d4a1321c2f487', '铃声助手', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/d2b783212d86ad5e0bd5f6524ef9e4e5.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/d2b783212d86ad5e0bd5f6524ef9e4e5.jpg', '铃声助手，手机铃声最热排行榜，精选铃声大全，好用的铃声同步设置助手！支持中国移动 中国联通 中国电信三网设置彩铃。 \n【海量曲库】 500万首铃声实时更新，网罗分享量超高的铃声，汇总个性又流行的彩铃； \n【语音搜铃】超好用的铃声搜索功能，哼节奏、说歌名、报歌手，精准定位你想要的铃声；只有你想不到的铃声，没有你找不到的铃声，就是这么任性！ \n【一键设置】来电铃声、短信、闹铃一键设置，操作简单，提供个性化彩铃创作功能，不服来战！ \n【无损音质】无损音质，音效调节，给你完美铃声体验。', '163');
