INSERT INTO `mini_info` VALUES ('eac3ad4957c645109e814710c0240582', '极简汇率', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/ba8caeb16b67e386c6a386142b1e9bea.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/ba8caeb16b67e386c6a386142b1e9bea.jpg', '从自身多年的出境经验出发，设计出快而准的银联汇率换算工具，是你出境游/境外购物等进行汇率换算的贴心助手。\n\n小贴士：\n1.点击国旗可切换货币\n2.小程序汇率源为银联卡境外刷卡汇率——「银联汇率」', '216');
INSERT INTO `mini_info` VALUES ('ec538fed7671419387be9d39ed23d77f', '快趣投', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/e13822c43af35c5f641bb90440734885.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/e13822c43af35c5f641bb90440734885.jpg', '投票召集聚会，定日子，上哪吃，活动评选。大事小事，一票敲定！来自公众号万言趣投，快趣投！', '341');
