INSERT INTO `mini_info` VALUES ('ecff4c2d789a464994252bc51e834c49', '小小包麻麻好物', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/32c0f928a891d029f7ff4d4b71dca1d2.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/32c0f928a891d029f7ff4d4b71dca1d2.jpg', '300万父母关注！正确辅食添加，幼儿疾病护理，母婴用品评测，0-4岁前沿育儿知识全在这里！', '404');
INSERT INTO `mini_info` VALUES ('ed3fc41c2ec742bea6bc0de7744f558b', '必胜公考', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/b65a032f530e95d394f0febf908ca558.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/b65a032f530e95d394f0febf908ca558.jpg', '必胜公考是北京必胜课教育旗下的一站式公务员备考服务平台，为考生提供权威的备考辅导，优质备考课程。', '5');
INSERT INTO `mini_info` VALUES ('ee4b1e5629e04d28aab710514fcd15f5', '会员预约', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/9dae474e17bfc187cb9b416b2f790313.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/9dae474e17bfc187cb9b416b2f790313.jpg', '有德者商户多场景小程序系统是针对预约门店服务的系统，以微信为主要平台，该系统能适应各种应用场景，比如高尔夫场地，酒店，摄影店，VR体验店，美甲等O2O生活服务', '24');
INSERT INTO `mini_info` VALUES ('eec28783b03d470ea4c93c654d7d4053', '汕头生活+', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/b50344bfd2627585b33f02b9d81c6921.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/b50344bfd2627585b33f02b9d81c6921.jpg', '「汕头生活+」是第一款服务于区域自媒体的小程序，在这里你可以了解第一手的汕头新鲜事，浏览纯正的潮语搞笑视频，与潮人圈子的你我他激萌互动！\n「汕头生活+」依靠于区域自媒体小程序平台 -- 海螺云（hailuoyun.cn）。海螺云致力于帮助公众号主以零技术的投入切入到小程序中，丰富小程序的生态，微信:dawnsail。', '345');
INSERT INTO `mini_info` VALUES ('eefdc70bed4f4b12a4bca97cc52cb452', '小D词典', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/69dfbab79281407adef521a4c54c1d6e.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/69dfbab79281407adef521a4c54c1d6e.jpg', '沪江小D词典是沪江推出的国内领先的多语种在线词典。界面清爽简洁，内容专业权威以及功能实用，让它成为千万用户的查词首选。', '502');
INSERT INTO `mini_info` VALUES ('ef114c14f1d046939756169c6ec70aed', '值得买购物攻略', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/b735f1ef6ce3d1a861c00513dfb08cae.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/b735f1ef6ce3d1a861c00513dfb08cae.jpg', '汇总什么值得买最有价值的购物攻略：有科技大神玩3C的数码心得，有白富美对护肤品的深度测评，更有老司机分享的各国海淘经验。', '285');
INSERT INTO `mini_info` VALUES ('f06c4291b9bf473c8c374217607dd240', '汇率助手', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/a870f9f6c1dbf731cd4d2cf930441d34.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/a870f9f6c1dbf731cd4d2cf930441d34.jpg', '1、支持全球160多个国家币种之间的汇率换算； 2、支持比特币、金、银、铜等贵金属汇率换算； 3、提供全国主流银行的实时外汇牌价信息，并提供各银行之间的比价功能，告诉你哪些银行买卖最亏、哪些银行买卖最赚。 4、提供汇入价、汇出价、钞入价、钞出价、中间价的历史曲线图表； 5、提供7天、1月、2月、3月、5月、半年、1年、3年、10年等不同时间维度的历史汇率图表； 6、无任何广告和内购，所有功能全部永久免费使用； 7、提供要闻、外汇、行业、能源、股市、债市、贵金属、期货、政经、央行等领域的新闻资讯和大家观点。', '173');
INSERT INTO `mini_info` VALUES ('f07f3a09ad0e4b02935af9a97bc404f5', '嗨图', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/08fdb39d55e951b1418bd0a93dfae0ba.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/08fdb39d55e951b1418bd0a93dfae0ba.jpg', '微信制作专属表情包，蓝色大海的传说、鬼怪、网络热图....海量素材只要你想的到的全都有，一键换字炒鸡方便！斗图、发朋友圈装x，你逗逼道路上的神助攻get√（微信搜索小程序：嗨图）', '433');
INSERT INTO `mini_info` VALUES ('f1ab287a98924978b684de1ce74fcb8e', '闪电健身Mini', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/fe0bd0a97af9c858774b41f55fad6ceb.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/fe0bd0a97af9c858774b41f55fad6ceb.jpg', '适合你的锻炼才会有效果。闪电健身，你不用成为专家，一样可以练出好身材。', '434');
INSERT INTO `mini_info` VALUES ('f1bd29f44d7f4b9a873ca0188089b98d', '嗨住租房', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/ec2dbe9ced09bd134bd8deda4c5d8d5b.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/ec2dbe9ced09bd134bd8deda4c5d8d5b.jpg', '嗨住，一个专业的租房平台，为您提供更真实更便捷的创新一站式租房服务。让租房世界从此变得简单而温暖。在我们不断的改进和优化中，力求让更多的用户获得前所未有的体验。\n— 智能+人工，双重筛选，保证所有房源真实有效，让找房不再海量筛选；\n— 0元中介费，让“不收中介费”的找房神话不再是传说；\n— 第三方监管，房租押金有担保，先行赔付；\n— 白条付租、信用卡付租、室友征选、搬家、维修更多服务，请移步任意手机应用市场下载“嗨住”。\n\n【联系方式】\n1、微信公众号：嗨住hizhu                           \n2、微博账号：嗨住hizhu\n3、服务热线：400-8786-999', '324');
