INSERT INTO `mini_info` VALUES ('f364b994d0604435b9a61f8c0d73bf9c', '租租车出国去哪玩', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/097af2955bad5fb26b57ae440b23e05f.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/097af2955bad5fb26b57ae440b23e05f.jpg', '“租租车出国去哪玩”是租租车旗下的小程序，它可帮助出国旅行用户，找到合适自己游玩的自驾线路，同时免费办理国际驾照认证件。', '451');
INSERT INTO `mini_info` VALUES ('f3f94d19539b4e4990ec1fad8331fc10', '好慷在家+', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/c9e7e670bbcaee954997f4af31c79180.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/c9e7e670bbcaee954997f4af31c79180.jpg', '不用下载APP，小程序预定更方便。全国30个城市、超100万家庭选择，好评率高达98%。让家务归好慷，让生活归生活。', '110');
INSERT INTO `mini_info` VALUES ('f4ba7347f02944209e20b03822affc8d', '美美买车＋', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/c66f2265ad2bba9e650f0860b56f1239.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/c66f2265ad2bba9e650f0860b56f1239.jpg', '美美买车是中国最专业的体验式汽车电商平台，汽车电商创新模式的引航者，为用户提供完美的线上购车体验。', '136');
INSERT INTO `mini_info` VALUES ('f4c8cba7b7ec46daa64d51ffd23fd598', '挖机小工具', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/bbb10e7e63bb6ebfaa52e8dab2d33f32.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/bbb10e7e63bb6ebfaa52e8dab2d33f32.jpg', '非常实用的挖机小工具，精准的挖机估价，故障代码、年份信息查询等', '325');
INSERT INTO `mini_info` VALUES ('f58166d453c34609a8c4acc584e0c5d5', '宝宝微空间', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/50d15ead7e75b90549bc1812b87ce0fe.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/50d15ead7e75b90549bc1812b87ce0fe.jpg', '宝宝微空间小程序提供便捷记录和分享宝宝成长的家庭私密空间，以“邀请”的方式实现与亲友一同见证和守护宝宝的成长。', '519');
INSERT INTO `mini_info` VALUES ('f6547246ca37490299bf427211913ca1', '手机号归属地查询', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/e3a2d5a6592a8c0d5bcd0439b7606a8a.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/e3a2d5a6592a8c0d5bcd0439b7606a8a.jpg', '手机归属地提供全面的手机号码归属地查询服务，包含有电话号码、移动手机号码、联通手机号码、固定号码归属地查询。', '113');
INSERT INTO `mini_info` VALUES ('f67f6dd3ed60436db30ada4875c0084b', '动动文字', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/6e104a1d21b35c0cc360bd28fa705209.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/6e104a1d21b35c0cc360bd28fa705209.jpg', '非常傻瓜好玩的一款小程序，能将任意文字变成动态图片。有多种特效可以选择，你只需要选好特效，然后输入文字，就可以一键生成动态文字。可以用于表情包、群聊斗图、文章配图等。简直是聊天、耍酷、卖萌、祝福必备的终极神器！用一用，保准让你的朋友惊讶不已~！对了，评论里有个别用户反馈的乱码问题，已经解决。谢谢你们！（上面的截屏是静态图，实际动态效果超级棒的哦~） 。', '300');
INSERT INTO `mini_info` VALUES ('f842bb3738894b4099862a147e5180ce', '小易测速', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/98a152b9404b3ce66ea0456c121d68ea.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/98a152b9404b3ce66ea0456c121d68ea.jpg', '小易测速是一款简单易用的测速工具，网速测试、4G、Wifi网络测速，结果快速准确。', '381');
INSERT INTO `mini_info` VALUES ('f8e3ea22f2c94003bd75d5d1ed91ea17', '美团生活', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/c9cee951c1e6fa1deda38be56506d82f.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/c9cee951c1e6fa1deda38be56506d82f.jpg', '美团生活官方小程序，打开更轻便，吃喝玩乐全都有。', '48');
