INSERT INTO `mini_info` VALUES ('f94653bf98f24581b7a754cda396354c', '轻芒杂志', 'http :// bugua.oss - cn - beijing.aliyuncs.com / mini - app / icon / a93ed127d115603873cd106e1bfd3d63.jpg', 'http :// bugua.oss - cn - beijing.aliyuncs.com / mini - app / qrcode / a93ed127d115603873cd106e1bfd3d63.jpg', '每个人都有兴趣，如果没有，就该培养一个。 超过 160 本精选兴趣杂志：涵盖家居、美食、护肤、艺文、宠物、运动、科技、旅行、手工等所有生活领域。从入门知识，到好物、配方和去处，每天更新适读好文章。还可以把你的兴趣告诉小花，它就能帮你定制一本自己的杂志。 简洁优美的笔记：在文章中发现别人留下的笔记、划下的重点，在分享的过程中发现更多乐趣。而只要轻松长按一段话或一张图，就可以方便添加你自己的笔记和摘录。 低密度排版：给生活足够的留白，希望你能每天轻松愉悦地打开。', '536');
