INSERT INTO `mini_info` VALUES ('fb24f39084ed46f09f1df901eda0a44a', '宝宝树孕育什么不能吃', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/icon/0bffd0d23d98fb8c833c57a516d04c92.jpg', 'http://bugua.oss-cn-beijing.aliyuncs.com/mini-app/qrcode/0bffd0d23d98fb8c833c57a516d04c92.jpg', '由宝宝树出品，专为孕妈妈、月子妈妈和宝宝提供科学、全面、细致的饮食禁忌查询服务，是最值得信赖的孕育人群饮食查询工具。', '51');
